Antenna (
Figs 144, 145
) with radicle 3.0– 3.8 × as long as wide, 0.31–0.38 × total length of scape, rest of scape 3.2–3.8 × as long as wide, faintly striate; pedicel longer than F 1 ; F 1 –F 4 subequal in length, shorter than following funicle segments; F 5 , F 7 , and F 8 subequal in length, F 6 a little shorter; F 1 –F 4 without mps, typically mps on F 5 ( 1 ), F 7 ( 2 ), and F 8 ( 2 ) but rarely F 5 with 2 mps or sometimes (often in small specimens) without mps, F 6 with 1 mps in a few, mostly large specimens (such as the holotype of
Lymaenon rhacodes
), and occasionally F 7 with just 1 mps; clava with 10 mps ( 4 in the middle and 6 subapical), 2.9–4.1 × as long as wide, from a little shorter to a little longer than combined length of F 6 –F 8 .

Mesosoma (
Fig. 146
). Propodeum (
Fig. 147
) with faint submedian lines, the distance between them shorter anteriorly than posteriorly. Fore wing (
Figs 148, 150
) 2.8–4.1 × as long as wide; longest marginal seta 0.28– 0.52 × maximum wing width. Fore wing disc almost hyaline (with a slight, uniform brownish tinge), almost bare behind submarginal vein except for a few setae behind its apex, more or less densely setose behind marginal vein and densely setose elsewhere. Hind wing (
Figs 149, 150
) 17–24 × as long as wide; disc setose and slightly infumate; longest marginal seta 2.3 –4.0× maximum wing width.

Metasoma (
Fig. 146
) a little longer than mesosoma. Petiole 1.6–2.1 × as wide as long. Ovipositor occupying 0.6–0.8 × length of gaster, not or barely exserted beyond its apex; ovipositor length: mesotibia length ratio 0.9–1.8 : 1 .
